import React from 'react';

class App extends Component {

  state = {
    friends
  };

  render() {
    return (
      <Wrapper>
        <Title>Click Game</Title>
        {this.state.friends.map(friend =>
          <FriendCard
          shuffleFriend={this.shuffleFriend}
          id={friend.id}
          key={friend.id}
          image={friend.image}
          />
          )}
      </Wrapper>
    )
  }
}
